var app=angular.module("myApp",["ngRoute"]);app.controller("MainController",["$scope","$http",function(t,n){n.get("../files/snapshot.csv").then(function(n){for(var e=n.data,r=e.split(/\r\n|\n/),l=r[0].split(","),o=r.length,p=[],a=0;a<o;){var i=r[a].split(","),s=l.length,h=i.length;if(h==s){for(var c=[],u=0;u<s;)c.push(i[u]),u++;p.push(c)}a++}return t.rows=p})}]),app.config(function(t){t.when("/",{templateUrl:"templates/main.html",controller:"MainController"}).otherwise({redirectTo:"/"})});